                <div id='logo'>
                    <Link to={'/'}><h2> Blogs</h2></Link>
                </div>
                <nav >
                    <ul id="navList">
                        <Link to={'/'}> <li id='navItems'>Home </li></Link>
                        {logged && <Link to={'/write'}><li id='navItems'>Write</li></Link>}
                        {logged ? "" : <Link to={'/write'}><li id='navItems'>Write</li></Link>}
                        {logged && <Link to={'/write'}><li id='navItems'>Write</li></Link>}
